import React  from "react";

const temas = [
    {
        "id":"Informatica",
        "sub": {
            "temas": ["Uno","dos","Tres"]
        }
    },
    {
        "id":"Concepto",
        "sub": {
            "temas": ["Uno","dos","tres"]
        }
    }
]

export function Nav(){
    return(
        <React.StrictMode>
            <ul>
                {
                    temas.map(type =>{
                        return(
                            <li>
                                {type.id}
                                <ul>
                                    {
                                        type.sub.temas.map(type => <li>{type}</li>)
                                    }
                                </ul>
                            </li>
                        )
                    })
                }
            </ul>
        </React.StrictMode>
    )
}
